import React from "react";
import Description from "./Description";
import View from "./View";
import logo from "../../images/logo.png";
import {
  TiSocialFacebook,
  TiSocialTwitter,
  TiSocialYoutube,
  TiSocialLinkedin,
} from "react-icons/ti";
import "./Media.css";
import { BsInstagram } from "react-icons/bs";

const Media = () => {
  return (
    <div className="hero">
      <Description />
      <View />
      <div className="hero-logo-bottom">
        <img className="hero-logo-img" src={logo} />
        <div className="social-icons">
          <ul className="hero-social-icons">
            <li>
              <TiSocialFacebook className="hero-social-icon" />
            </li>
            <li>
              <TiSocialTwitter className="hero-social-icon" />
            </li>
            <li>
              <TiSocialYoutube className="hero-social-icon" />
            </li>
            <li>
              <TiSocialLinkedin className="hero-social-icon" />
            </li>
            <li>
              <BsInstagram className="hero-social-icon" />
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Media;
